import "./Footer.css";

import zooluftLogo from "../img/ZooluftLogo.png";
import { ReactComponent as instagramLogo }  from "../img/InstagramLogo.png";


function Header() {
  return (
    <div className="footer-wrapper">
        <div><img src={zooluftLogo} alt=""></img></div>
      <div className="media-wrapper">
        <div>
          <instagramLogo></instagramLogo>
        </div>
        <div>
          <instagramLogo></instagramLogo>
        </div>
        <div>
          <instagramLogo></instagramLogo>
        </div>
      </div>
      <div></div>
    </div>
  );
}

export default Header;
